import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Button, Row, Col, Card } from 'react-bootstrap';

const LandingPage = () => {
  const [blogPosts, setBlogPosts] = useState([]);
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    const fetchBlogPosts = async () => {
      try {
        const response = await axios.get('https://blog.smswithoutborders.com/feed');
        // Assuming response.data contains the blog posts
        setBlogPosts(response.data.items);
      } catch (error) {
        console.error('Error fetching blog posts:', error);
      }
    };

    const fetchProjects = async () => {
      try {
        const response = await axios.get('https://blog.smswithoutborders.com/feed');
        // Assuming response.data contains the projects
        setProjects(response.data.items);
      } catch (error) {
        console.error('Error fetching projects:', error);
      }
    };

    fetchBlogPosts();
    fetchProjects();
  }, []);

  return (
    <Container className="my-5">
      <div className="p-5 mb-4 bg-light rounded-3 text-center">
        <div className="container-fluid py-5">
          <h1 className="display-5 fw-bold">Welcome to the Project Website</h1>
          <p className="fs-4">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>
          <Button variant="primary" href="/features">Learn more</Button>
        </div>
      </div>


      <Row className="mb-5">
      <h2 className="text-center my-4">About Us</h2>
        <Col lg={6} className="mb-4">
          <img src="https://via.placeholder.com/500x300" alt="About Us" className="img-fluid rounded" />
        </Col>
        <Col lg={6} className="mb-4">
          <h3>About Our Project</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam scelerisque id nunc nec volutpat. Etiam pellentesque tristique arcu, non consequat magna fermentum ac. Cras ut ultricies eros. Maecenas eros justo, ullamcorper a sapien id, viverra ultrices eros. Morbi sem neque, posuere et pretium eget, bibendum sollicitudin lacus. Aliquam eleifend sollicitudin diam, eu mattis nisl maximus at. Vestibulum a augue placerat, tincidunt risus quis, ornare risus.</p>
        </Col>
      </Row>

      <Row>
      <h2 className="text-center mb-4">Features</h2>
        <Col lg={4} md={6} className="mb-4">
          <Card>
            <Card.Img variant="top" src="https://via.placeholder.com/150" />
            <Card.Body>
              <Card.Title>Feature 1</Card.Title>
              <Card.Text>
                This is a longer card with supporting text below as a natural lead-in to additional content.
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
        <Col lg={4} md={6} className="mb-4">
          <Card>
            <Card.Img variant="top" src="https://via.placeholder.com/150" />
            <Card.Body>
              <Card.Title>Feature 2</Card.Title>
              <Card.Text>
                This is a longer card with supporting text below as a natural lead-in to additional content.
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
        <Col lg={4} md={6} className="mb-4">
          <Card>
            <Card.Img variant="top" src="https://via.placeholder.com/150" />
            <Card.Body>
              <Card.Title>Feature 3</Card.Title>
              <Card.Text>
                This is a longer card with supporting text below as a natural lead-in to additional content.
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      </Row>



      <Row>
      <h2 className="text-center my-4">Latest Blog Posts</h2>
        {blogPosts.slice(0, 3).map((post, index) => (
          <Col lg={4} md={6} className="mb-4" key={index}>
            <Card>
              <Card.Img variant="top" src={post.thumbnail} />
              <Card.Body>
                <Card.Title>{post.title}</Card.Title>
                <Card.Text>{post.description}</Card.Text>
                <Button variant="primary" href={post.link}>Read More</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      <Row>
      <h2 className="text-center my-4">Latest Projects</h2>

        {projects.slice(0, 3).map((project, index) => (
          <Col lg={4} md={6} className="mb-4" key={index}>
            <Card>
              <Card.Img variant="top" src={project.thumbnail} />
              <Card.Body>
                <Card.Title>{project.title}</Card.Title>
                <Card.Text>{project.description}</Card.Text>
                <Button variant="primary" href={project.link}>View Project</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default LandingPage;
